window.bookSummaryJSON = "<p><b>“One of the best thriller writers we have.” (Harlan Coben, number one </b><b><i>New York Times</i></b><b> best-selling author)</b></p> <p><b>From the international and instant </b><b><i>New York Times</i></b><b> best-selling author of </b><b><i>The Dirty South</i></b><b>, the white-knuckled Charlie Parker series returns with this heart-pounding race to hunt down the deadliest of war criminals.</b></p> <p>In Amsterdam, four bodies, violently butchered, are discovered in a canal house, the remains of friends and confidantes of the assassin known only as Louis.</p> <p>The men responsible for the murders are Serbian war criminals. They believe they can escape retribution by retreating to their homeland.</p> <p>They are wrong.</p> <p>For Louis has come to Europe to hunt them down: five killers to be found and punished before they can vanish into thin air.</p> <p>There is just one problem.</p> <p>The sixth. </p> <p>With John Connolly’s trademark “dark, haunting, and beautifully told” (<i>Booklist</i>) prose and breathless twists and turns, <i>The Nameless Ones </i>is an unputdownable thriller that will keep you on the edge of your seat.</p>"; 
